import React from 'react';
import hikaye from '../data/hikaye.json';


const HomeInstagram = ({ story }) => {
    return (
        <div className='flex items-center'>
            <div className='w-[66px] h-[66px] rounded-full'>
                <img src={story.image} alt='' className='w-14 h-14 object-contain' />
            </div>
        </div>
    );
};

export default HomeInstagram;
